	"download_options.archive_images": "Compresser le fichier d\u2019image une fois la bande dessin\u00e9e t\u00e9l\u00e9charg\u00e9e.",
	"download_options.archive_old_works": "Anciennes \u0153uvres achev\u00e9es. Actuellement utile seulement pour les bandes dessin\u00e9es dans des fichiers compress\u00e9s, vous devez d\u00e9finir `archive_images=true`. Ce n\u2019est pas pr\u00e9d\u00e9fini pour sceller les anciennes \u0153uvres. Si vous entrez \u00ab\u202f3M\u202f\u00bb, cela sera stock\u00e9 et archiv\u00e9 durant plus de 3 mois sans remettre \u00e0 jour l\u2019\u0153uvre t\u00e9l\u00e9charg\u00e9e. Si vous entrez \u00abtrue\u202f\u00bb (vrai), l\u2019intervalle pr\u00e9d\u00e9fini \u00ab\u202f0.5Y\u202f\u00bb sera utilis\u00e9 et il n\u2019y aura aucune \u0153uvre t\u00e9l\u00e9charg\u00e9e \u00e0 nouveau durant la moiti\u00e9 d\u2019une ann\u00e9e.",
	"download_options.archive_program_path": "Chemin complet de l\u2019ex\u00e9cutable de 7-Zip entre guillemets (\"\").",
	"download_options.cache_title_to_id": "Lors du t\u00e9l\u00e9chargement d\u2019une \u0153uvre avec un identifiant, le titre de l\u2019\u0153uvre correspondant \u00e0 l\u2019identifiant en cache sera enregistr\u00e9. Apr\u00e8s avoir activ\u00e9 cette fonctionnalit\u00e9, vous n\u2019aurez pas \u00e0 rechercher \u00e0 nouveau lorsque vous entrerez une prochaine fois le titre de l\u2019\u0153uvre. Si cette fonctionnalit\u00e9 n\u2019est pas activ\u00e9e, cela ne sera pas g\u00e9n\u00e9r\u00e9 comme un fichier en cache (la valeur par d\u00e9faut est \u00ab\u202f.search_result_file_name=search.json\u202f\u00bb).",
	"download_options.chapter_filter": "Filtrer les mots-cl\u00e9s de titre des chapitres que vous voulez t\u00e9l\u00e9charger. Par exemple, \u00ab\u202flivre unique\u202f\u00bb.",
	"download_options.chapter_time_interval": "Lorsque le site web ne permet pas des acc\u00e8s ou lectures trop fr\u00e9quents, vous pouvez d\u00e9finir le d\u00e9lai d\u2019attente (en ms par d\u00e9faut) avant de t\u00e9l\u00e9charger les informations et le contenu du chapitre suivant. Par exemple, s\u2019il faut 30 secondes dans une situation normale pour lire un chapitre, vous pouvez le d\u00e9finir \u00e0 \u00ab\u202f30s\u202f\u00bb. Peut \u00eatre utilis\u00e9 avec l\u2019option \u00ab\u202fone_by_one\u202f\u00bb.",
